var app=angular.module("HostessApp",["ngRoute","angular-carousel","thehostess.services","hostess.controllers","hostess.directives","ui.bootstrap","ngAnimate"]);app.run(function(a){a.mapsData=null}),app.config(["$routeProvider",function(a){a.when("/home",{templateUrl:"scripts/src/views/insideArea.html",controller:"overallController"}).when("/editMap",{templateUrl:"scripts/src/views/editMapView.html",controller:"editMapController",resolve:{mapsData:function(a,b){var c=new Date,d=(c.getDate()<10?"0":"")+c.getDate()+"/"+(c.getMonth()+1<10?"0":"")+(c.getMonth()+1)+"/"+c.getFullYear();return a.getMapsData(d)}}}).when("/map",{templateUrl:"scripts/src/views/mapView.html",controller:"mapController",resolve:{mapsData:function(a,b){var c=new Date,d=(c.getDate()<10?"0":"")+c.getDate()+"/"+(c.getMonth()+1<10?"0":"")+(c.getMonth()+1)+"/"+c.getFullYear();return a.getMapsData(d)}}}).otherwise({redirectTo:"/map"})}]);